    and other variables collected from discrete sample and profile observations using
    CTD, bottle and other instruments from the TANGAROA in the Indian Ocean from 2003-02-17
    to 2003-03-12 (NODC Accession 0113599)",nt"tracking_summary": {ntt"total":
