    [],nt"revision_timestamp": "2015-09-27T02:54:13.917945",nt"name": "dissolved-inorganic-carbon-temperature-salinity-and-other-variables-collected-from-discrete-sam46943",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0113599 includes biological,
    chemical, discrete sample, physical and profile data collected from TANGAROA in
    the Indian Ocean from 2003-02-17 to 2003-03-12 and retrieved during cruise (JARE44)
    and CARINA/61TG20030217. These data include AMMONIUM, CHLOROPHYLL A, DISSOLVED INORGANIC
    CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHAEOPHYTIN, Potential
    temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
    to collect these data include CTD and bottle. These data were collected by Masao
    Ishii of Meteorological Research Institute; Geochemical Research Department and
    T. Odate [affiliation unknown] as part of the CARINA/61TG20030217 data set.nnThe
    CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
    collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
    a merged internally consistent data set of open ocean subsurface measurements for
    biogeochemical investigations, in particular, studies involving the carbon system.
    The original focus area was the North Atlantic Ocean, but over time the geographic
    extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
    Ocean, and the Southern Ocean.",nt"license_title": null,nt"extras": [{ntt"key":
